import{_ as e,o as t,c as n,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 50-73.127 Effect of conversion; entity unchanged.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.127.md","filePath":"vacode/50-73.127.md"}'),o={name:"vacode/50-73.127.md"},r=i('<h1 id="§-50-73-127-effect-of-conversion-entity-unchanged" tabindex="-1">§ 50-73.127 Effect of conversion; entity unchanged. <a class="header-anchor" href="#§-50-73-127-effect-of-conversion-entity-unchanged" aria-label="Permalink to &quot;§ 50-73.127 Effect of conversion; entity unchanged.&quot;">​</a></h1><p>A. A limited partnership that has been converted pursuant to this article is for all purposes the same entity that existed before the conversion.</p><p>B. When a conversion takes effect:</p><ol><li><p>All property owned by the converting limited partnership remains vested in the resulting partnership;</p></li><li><p>All obligations of the converting limited partnership continue as obligations of the resulting partnership; and</p></li><li><p>An action or proceeding pending against the converting limited partnership may be continued as if the conversion had not occurred.</p></li></ol><p>1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0292" target="_blank" rel="noreferrer">292</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0631" target="_blank" rel="noreferrer">631</a>.</p>',5),a=[r];function c(s,l,p,h,d,f){return t(),n("div",null,a)}const u=e(o,[["render",c]]);export{g as __pageData,u as default};
